import './App.css';

import * as React from 'react';


function App() {
  return (
    <div className="App">
      <div className="Header-container">
        <header className="App-header">
          <p>hello world</p>
        </header>
      </div>

      <div className="Body">
        <body className="App-body">
            <p> hello world 2 </p>
        </body>
      </div>
    </div>
  );
}


export default App;
